<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>

<style>
    *{
        margin: 0;
        padding: 0;
        box-sizing: border-box;
    }
    body{
        background: url("https://catherineasquithgallery.com/uploads/posts/2021-03/1614644937_20-p-fon-leto-dlya-fotoshopa-20.jpg") center/cover no-repeat fixed;
    }
    img{
        display:block;
        width:200px;
        height:200px;
        margin:auto;
        margin-top:100px;
        border:4px dashed black;
        border-radius: 50%;
        box-shadow: 0 0 30px #00ff7f;
    }

p{
    font-size: 1em;
    font-weight: bold;
    font-family: 'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
}

.first{
    color: red;
}
.second{
    color: yellow;
}
#myId{
    border: 0;
    box-shadow:0 0 20px red inset;
}

h1{
    width: 200px;
    height: 200px;
    border:5px solid indianred;
    margin: auto;
    box-shadow: 0 0 0 0 indianred;
    transition-property: box-shadow;
    transition-duration:2s;
}

h1:hover{
    box-shadow: 0 0 30px 30px green;
    transition-property: box-shadow;
    transition-duration:2s;
}

</style>

</head>
